import Link from 'next/link';
import Header from '../component/header';

const additionalLinks = props => (
	<li>
		<Link href={'/post?title=${props.title}'}></Link>
	</li>
);

const Index = () => (
	<div>	
		<Header />	
		<main>
			<p>Hello buddy!</p>
		</main>
	</div>
);

export default Index;
